var mesh,image,imageBump;
var nImage=0;
var isDiag=true;
var incli=-3.12*Math.PI/180;
var noAxe=false;
var hasSat=true;
var nbEnv=4;
var tEnv=[71000 ,59000,14000,7000];
var tColEnv=["#CCEEEE","#778888","#88AAAA","#AA8888"];
